import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 59.1-335 Penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-335.md","filePath":"vacode/59.1-335.md"}'),o={name:"vacode/59.1-335.md"},i=t('<h1 id="§-59-1-335-penalties" tabindex="-1">§ 59.1-335 Penalties. <a class="header-anchor" href="#§-59-1-335-penalties" aria-label="Permalink to &quot;§ 59.1-335 Penalties.&quot;">​</a></h1><p>A. Any person violating any of the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/59.1-317/" target="_blank" rel="noreferrer">59.1-317</a>, <a href="http://law.lis.virginia.gov/vacode/59.1-318/" target="_blank" rel="noreferrer">59.1-318</a>, <a href="http://law.lis.virginia.gov/vacode/59.1-326/" target="_blank" rel="noreferrer">59.1-326</a>, <a href="http://law.lis.virginia.gov/vacode/59.1-327/" target="_blank" rel="noreferrer">59.1-327</a>, <a href="http://law.lis.virginia.gov/vacode/59.1-328/" target="_blank" rel="noreferrer">59.1-328</a>, and <a href="http://law.lis.virginia.gov/vacode/59.1-329/" target="_blank" rel="noreferrer">59.1-329</a> or a cease and desist or temporary order issued pursuant to § <a href="http://law.lis.virginia.gov/vacode/59.1-324/" target="_blank" rel="noreferrer">59.1-324</a> shall be guilty of a Class 1 misdemeanor and any person violating any of the provisions of § <a href="http://law.lis.virginia.gov/vacode/59.1-332/" target="_blank" rel="noreferrer">59.1-332</a> shall be guilty of a Class 3 misdemeanor. Other than with reference to § <a href="http://law.lis.virginia.gov/vacode/59.1-332/" target="_blank" rel="noreferrer">59.1-332</a> each violation shall be deemed a separate offense.</p><p>B. Any violation of the provisions of this chapter shall constitute a prohibited practice pursuant to the provisions of § <a href="http://law.lis.virginia.gov/vacode/59.1-200/" target="_blank" rel="noreferrer">59.1-200</a> and shall be subject to any and all of the enforcement provisions of the Virginia Consumer Protection Act (§ <a href="http://law.lis.virginia.gov/vacode/59.1-196/" target="_blank" rel="noreferrer">59.1-196</a> et seq.) of this title.</p><p>1985, c. 409; 1992, c. 545.</p>',4),n=[i];function l(s,h,c,f,v,p){return a(),r("div",null,n)}const g=e(o,[["render",l]]);export{_ as __pageData,g as default};
